  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "10.1985/(1.0+exp(200.0*(sqrt(x*x+y*y)-0.031)))"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
