FUNCT7:
  - VARFUNCTION: "porosity*S2*phi2*((9.6e-9*(phi1-2.0e-6)/(4.2e-6-2.0e-6)*heaviside((phi1-2.0e-6)/(4.2e-6-2.0e-6))*heaviside(1.3e6-p2))*(1-phi2))"
